import json

def json_to_dict(json_string):
    try:
        data = json.loads(json_string)
        if isinstance(data, dict):
            return {key: value for (key, value) in data.items() if key not in ['name', 'age', 'city']}
        else:
            return {}
    except json.JSONDecodeError:
        return {}

